// import React, { useState} from "react";
import ExpenseItem from "./ExpenseItem.js";
import "./Expenses.css";
import Card from "../UI/Card.js";
import React ,  {useState} from 'react' 
import ExpensesFilter from "../Filter/ExpensesFilter.js"

function Expenses(props){
  const [filterYear, setFilterYear]= useState('2022');
  const filterChangeHandler=(selectedYear)=>{
    // console.log(selectedYear+" this is what i want");
    setFilterYear(selectedYear);
  }
    return(
      <div>
      <Card className="expenses">
      <ExpensesFilter selected={filterYear} onChangeFilter={filterChangeHandler}></ExpensesFilter>
      <ExpenseItem expense ={props.expenses[0]}></ExpenseItem>
      <ExpenseItem expense ={props.expenses[1]}></ExpenseItem>
      <ExpenseItem expense ={props.expenses[2]}></ExpenseItem>
      <ExpenseItem expense ={props.expenses[3]}></ExpenseItem>
      </Card> 
      </div>
    );
}
export default Expenses;
